#include <iostream>
#include <vector>
using namespace std;

class Solution
{
public:
    void swap(int &a, int &b)
    {
        int tmp = a;
        a = b;
        b = tmp;
    }
    int partition(vector<int> &v, int low, int high)
    {
        int pivot_index = low + random() % (high - low + 1);
        int pivot = v[pivot_index];
        swap(v[pivot_index], v[high]);
        int i = low;
        int j = low;
        while (j < high)
        {
            if (v[j] >= pivot)
            {
                swap(v[i], v[j]);
                i++;
            }
            j++;
        }
        swap(v[i], v[high]);
        return i;
    }

    int kth_max(vector<int> &v, int k, int i, int j)
    {
        int par = partition(v, i, j);
        if (par + 1 == k)
        {
            return v[par];
        }
        if (par >= k)
            return kth_max(v, k, i, par - 1);
        else
            return kth_max(v, k, par + 1, j);
    }

    int findKthLargest(vector<int> &nums, int k)
    {
        int n = nums.size();
        cout<<n<<" "<<k<<"\n";
        if (n < k)
        {
            return 0;
        }
        return kth_max(nums, k, 0, n - 1);
    }
};

